import React from 'react';
import miamiPic from '../resources/miami.png';
import { Link } from 'react-router-dom';
import Miami from '../cities/Miami';

const Home = () =>{
    return (
    <Link to="/miami">
        <article>
            <img src={miamiPic} alt="Miami Beach"></img>
            <h2>Miami</h2>
        </article>
    </Link>
    )
}

export default Home;
